- Key: ReleaseNotesUrl
  Value: https://www.mozilla.org/firefox/126.0/releasenotes/
- Locale: en-US
  Key: ReleaseNotes
  Value: |-
    New
    - The Copy Without Site Tracking option can now remove parameters from nested URLs. It also includes expanded support for blocking over 300 tracking parameters from copied links, including those from major shopping websites. Keep those trackers away when sharing links!

    - Firefox now supports Content-encoding: zstd (zstandard compression). This is an alternative to broti and gzip compression for web content, and can provide higher compression levels for the same CPU used, or conversely lower server CPU use to get the same compression. This is heavily used on sites such as Facebook.
    - Catalan is now available in Firefox Translations.
    - Enabled AV1 hardware decode acceleration on macOS for M3 Macs.
    - Telemetry was added to create an aggregate count of searches by category to broadly inform search feature development. These categories are based on 20 high-level content types, such as "sports, "business," and "travel". This data will not be associated with specific users and will be collected using OHTTP to remove IP addresses as potentially identifying metadata. No profiling will be performed, and no data will be shared with third parties.
    Fixed
    - Various security fixes.
    Changed
    - The URL Paste Suggestion feature added in Fx125 was temporarily disabled while the team investigates a potential performance issue. The feature will be re-enabled in a future release once the performance issue is addressed.
    Enterprise
    - You can find information about policy updates and enterprise specific bug fixes in the Firefox for Enterprise 126 Release Notes.
    Developer
    - Added an option to disable/enable the Developer Tools' split console feature.
    Web Platform
    - Implemented URL.parse(). Unlike the URL constructor, which throws when parsing fails, the static URL.parse() method returns null instead.
    - The CSS zoom property has been enabled by default following a lot of web compatibility and standardization work in the CSSWG.
    - Added support for CSS Custom :state() and CustomStateSet pseudo-classes.
    - Added support for Screen Wake Lock API.
    - Added support for IDBFactory.databases for enumeration of IndexedDB databases.
    Unresolved
    - On macOS, the text in the Crash Reporter dialog box is not localized for the non-en-US locales. This is tracked under Bug 1896097 and we will rollout a fix in a future release.
    Community Contributions
    - With the release of Firefox 126, we are pleased to welcome the developers who contributed their first code change to Firefox in this release, 12 of whom were brand new volunteers! Please join us in thanking each of these diligent and enthusiastic individuals, and take a look at their contributions:
      - [:flowejam]: 1885693
      - Amit Prakash Ambasta: 1889054
      - Atlas Foulks: 243797, 1273551
      - Camille: 1856717, 1883058
      - Christoph Moench-Tegeder: 1890593
      - gravyant: 1838152
      - Harshit: 1888221
      - Mika Valkealahti: 1879304
      - Nuohan Li: 1888420
      - serfreeman1337: 1810362
      - siddharthaswarnkar: 1825386, 1853829
      - Vaibhav Mali: 1880783
